import React from 'react';
import PropTypes from 'prop-types';

const Name = ({demo}) => {
    

    return (
        <div className="row mt-2">
            <label for={demo}>{demo}</label>
            <input id={demo} className="col-9 form-control" />
      </div>
    );
};

Name.propTypes = {
    
};

export default Name;
